import { MatSidenavModule } from '@angular/material/sidenav';

@Component({
  selector: 'app-no-jpg-files',
  templateUrl: './no-jpg-files.component.html',
  styleUrls: ['./no-jpg-files.component.css'],
  standalone: true,
  imports: [MatSidenavModule],
})
export class NoJpgFilesComponent {

}
<p>no-jpg-files works!</p>
<mat-drawer-container class="example-container">
    <mat-drawer mode="side" opened>Drawer content</mat-drawer>
    <mat-drawer-content>Main content</mat-drawer-content>
</mat-drawer-container>
